import Navbar from './nav';
function Products() {
    const [info, setdata] = useState([]);
    const [branding,setbrand]=useState([]);
    
    
    useEffect(() => {
        axios.get(`http://localhost:3001/getproducts/fujifilm`)

            .then(res => setdata(res.data))
            .catch(err => console.log(err));
    }, []);
   
        return (
            <section id='pro'>
            <Navbar/>
                <div className='s'>
                    <div className='p'>
                    <h2>Popular Products</h2>
                        { info.map((pro) => (
                            <Link to={ `/product/${pro._id}`}key={pro._id}>


                            </Link>
                        ))}
                    </div>
                </div>
            </section>
        )
    }

    
export default Products;
